window.bookSummaryJSON = "<p><b>Two gods, one stubborn mate, a shadow friend, and a war I can't stop.</b></p> <p>Choosing love seems impossible. Especially when I'm not the only one who wants my dragon king...</p> <p>My name is Serendipity Fall, and I've unleashed a fallen god who will stop at nothing to destroy everything I love.</p> <p>The Wolven gods want me to kill my mate… and I can't. Not now, not ever. With the mysterious witch lord's help, I have to find a way to escape them and save Nakoa from my mate.</p> <p>Once, a long time ago, a goddess spoke of a prophecy before she was killed… and it's going to destroy us all.</p> <p><i>This is a full-length reverse harem romance novel full of sexy alpha males, steamy scenes, a strong heroine, and a lot of sarcasm. Book seven of eight. For mature listeners. Narrated in duet style.</i></p>"; 
